import React from 'react';

import SideBar from './components/SideBar';
import WorkArea from './components/WorkArea';
import './App.css';

function App() {
    return (

        <div className="App" style={{display: 'flex'}}>
            <SideBar createNewTab={() => console.log('Create new tab')}/>
            <WorkArea/>
        </div>
    );
}

export default App;
